import React from 'react';

const Friends = (props) => {
    if (props.status)
    if (!props.users.length) {
        return <div>Users not found</div>
    }
    return <div> {props.users.map(user => <div>
            <img src={user.photos.small}/>
            <span>{user.status}</span>
        </div>
    )
    }
    </div>
}

export default Friends
